using namespace cv;
using namespace std;



 int ustc_Find_Circles_By_Difference(Mat colorImg,int min_radius,int max_radius,int min_center_dist,int min_radius_dist,
	 int max_circle_diff,int* x,int* y,int* radius, int* circle_cnt, int max_circle) {
	if (!colorImg.data) {
		cout << "no img" << endl;
		return MY_FAIL;
	}
	if (colorImg.channels() != 3) {
		cout << "channel error" << endl;
		return MY_FAIL;
	}
	if (max_radius * 2 >= colorImg.rows || max_radius * 2 >= colorImg.cols) {
		cout << "too large radius" << endl;
		return MY_FAIL;
	}
	if (!x || !y || !radius || !circle_cnt) {
		cout << "no sapce allocated" << endl;
		return MY_FAIL;
	}

	int x_tem[10000] = { 0 };
	int y_tem[10000] = { 0 };
	int radius_tem[10000] = { 0 };
	int finish = 0;//指示查找是否结束

	int nrow = colorImg.rows;
	int ncol = colorImg.cols;
	uchar *pri = colorImg.data;
	int num = 0;
	*circle_cnt=0;

	float diff[10000] = { 0 };
	//获取梯度图
	Mat gray;
	Mat grays(nrow, ncol, CV_16S);
	Mat grayxs;
	Mat grayys;
	Mat grayxu(nrow, ncol, CV_8U);
	Mat grayyu(nrow, ncol, CV_8U);
	Mat grayxf(nrow, ncol, CV_32F);
	Mat grayyf(nrow, ncol, CV_32F);
	Mat magf(nrow,ncol, CV_32F);
	Mat magu(nrow, ncol, CV_8U);

	cvtColor(colorImg, gray, CV_BGR2GRAY);
	gray.convertTo(grays, CV_16S);

	Sobel(grays, grayxs, CV_16S, 1, 0, 3, 1);
	Sobel(grays, grayys, CV_16S, 0, 1, 3, 1);
	convertScaleAbs(grayxs, grayxs);
	convertScaleAbs(grayys, grayys);
	grayxs.convertTo(grayxu, CV_8U);
	grayys.convertTo(grayyu, CV_8U);
	
	grayxu.convertTo(grayxf, CV_32F);
	grayyu.convertTo(grayyf, CV_32F);
	magnitude(grayxf, grayyf, magf);
	magf.convertTo(magu, CV_8U);
	cv::threshold(magu, magu, max_circle_diff+10, 1, cv::THRESH_BINARY);
	
	///////////////////////////////////////////////////////////////////////////////

	for (int i = 0; i < nrow ; i++) {
		for (int j = 0; j < ncol ; j++) {
			for (int r = min_radius; r <=max_radius; r++) {
				 int innerb = 0;
				 int innerg = 0;
				 int innerr = 0;

				 int outb = 0;
				 int outg = 0;
				 int outr = 0;

				float aveb = 0;
				float aveg = 0;
				float aver = 0;
				float ave_total = 0;

				int innum = 0;
				int outnum = 0;
     //用于处理截止角度
				int thetamin;
				int angle;
				int flag1 = 1;//up
				int flag2 = 1;//down
				int flag3 = 1;//left
				int flag4 = 1;//right
				int flag0 = 0;
				if (i - 5 - r < 0) flag1 = 0;
				if (i + 5 + r >= nrow) flag2 = 0;
				if (j - 5 - r < 0) flag3 = 0;
				if (j + 5 + r >= ncol) flag4 = 0;
				flag0 = (flag1 << 3) + (flag2 << 2) + (flag3 << 1) + flag4;
				switch (flag0) {
				case 15:thetamin = 0; angle = 360; break;//whole
				case 5:thetamin = 0; angle = 90; break;//rd
				case 6:thetamin = 90; angle = 90; break;//ld
				case 9:thetamin = 270; angle = 90; break;//ru
				case 10:thetamin = 180; angle = 90; break;//lu
				case 13: thetamin = 270; angle = 180; break;//r
				case 14: thetamin = 90; angle = 180; break;//l
				case 7:thetamin = 0; angle = 180; break;//d
				case 11:thetamin = 180; angle = 180; break;//u
				angle = 0; break;
				}
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
				int in_radius = r - 30;
				int out_radius = r - 20;
				int mid_radius = r - 25;
				int point_num = 0;//计数一周上的未被遮挡点
				for (int theta = thetamin,ang=0; ang < angle; ang++,theta=(theta++)%360) {
				
					int in_radius = r - 30;
					int out_radius = r - 20;
					int mid_radius = r - 25;
					int xo = j + (int)cost[out_radius][theta];
					int yo = i + (int)sint[out_radius][theta];
					int xi = j + (int)cost[in_radius][theta];
					int yi = i + (int)sint[in_radius][theta];
					int xm =j + (int)cost[mid_radius][theta];
					int ym = i + (int)sint[mid_radius][theta];
		
					int in_index = yi*ncol * 3 + xi;
					int out_index = yo*ncol * 3 + xo;
					int mid_index= ym*ncol  + xm;
					int stai = ((uchar*)magu.data)[yi*ncol + xi];
					int stao = ((uchar*)magu.data)[yo*ncol + xo];

					if (((uchar*)magu.data)[mid_index]) {
						outb += pri[out_index];
						outg += pri[out_index + 1] ;
						outr += pri[out_index + 2] ;

						innerb += pri[in_index];
						innerg += pri[in_index + 1];
						innerr += pri[in_index + 2];
						point_num++;
					}
				}

				if (point_num>300) {
					aveb = abs(outb - innerb)*1.0 / point_num;
					aveg = abs(outg - innerg)*1.0 / point_num;
					aver = abs(outr - innerr)*1.0 / point_num;
					ave_total = aveb + aveg + aver;
			
				}


				if (ave_total >=  max_circle_diff&&num<10000) {
					x_tem[num] = j;
					y_tem[num] = i;
					radius_tem[num] = r;
					diff[num] = ave_total;
					num++;
					r += min_radius_dist;
				}
			}
		}
	}

	end:
	//非极大值抑制
	int centre2 = min_center_dist*min_center_dist;
	for (int i = 0; i < num; i++) {
		if (x_tem[i] == -1) continue;
		for (int j = 0; j < num; j++) {
			if (i == j) continue;
			if (x_tem[j] == -1) continue;
			if ((x_tem[i]-x_tem[j])*(x_tem[i] - x_tem[j])+ (y_tem[i] - y_tem[j])*(y_tem[i] - y_tem[j]) < centre2)
				if (abs(radius_tem[i] - radius_tem[j]) < min_radius_dist) {
					if (diff[i] < diff[j]) {
						x_tem[i] = x_tem[j]; y_tem[i] = y_tem[j]; radius_tem[i] = radius_tem[j]; diff[i] = diff[j];
					}
					x_tem[j] = y_tem[j] = radius_tem[j] = diff[j] = -1;
				}
		}
	}
	int j = 0;
	for (int i = 0; i<num; i++) {
		if (x_tem[i] == -1) continue;
		else {
			x_tem[j] = x_tem[i]; y_tem[j] = y_tem[i]; radius_tem[j] = radius_tem[i]; diff[j] = diff[i];
			j++;
		}
		}
	x_tem[j] = -1;//end
	float tem = 0;
	
	//排序
	for (int i = 0; i < j; i++) {
		for (int k = j-1; k >i; k--) {
			if (diff[k] > diff[k - 1]) {
				tem = x_tem[k]; x_tem[k] = x_tem[k - 1]; x_tem[k - 1] = tem;
				tem = y_tem[k]; y_tem[k] = y_tem[k - 1]; y_tem[k - 1] = tem;
				tem = radius_tem[k];  radius_tem[k] = radius_tem[k - 1]; radius_tem[k - 1] = tem;
				tem = diff[k];  diff[k] = diff[k - 1]; diff[k - 1] = tem;
			}
		}
	}
	
	for (*circle_cnt=0; *circle_cnt < max_circle && *circle_cnt < j; (*circle_cnt)++) {
		x[*circle_cnt] = x_tem[*circle_cnt]; y[*circle_cnt] = y_tem[*circle_cnt]; radius[*circle_cnt] = radius_tem[*circle_cnt];
	}

	
	/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
#ifdef SHOW
	for (int i = 0; i<*circle_cnt; i++) {
		Point centre(x[i],y[i]);
		circle(colorImg, centre, radius[i],Scalar(0, 255, 0),10);
	}
	imshow("circle", colorImg);
	waitKey();
#endif

	return MY_OK;
}
